import React from 'react';
import '../Title/Title.css';
import {Link} from 'react-router-dom';

function Title() {

    function Home() {
        return <h2>Home 페이지</h2>;
    }
    
    function Login() {
        return <h2>Login 페이지</h2>;
    }
    
    function Mypage() {
        return <h2>Mypage 페이지</h2>;
    }
    
    function Order() {
        return <h2>Order 페이지</h2>;
    }
    
    function Cart() {
        return <h2>Cart 페이지</h2>;
    }
    
    function QnA() {
        return <h2>QnA 페이지</h2>;
    }
    
    return (
        <div>
            <div className="Title">
                <div className="txt_01"><Link to='./login'>Login</Link></div>
                <div className="txt_02"><Link to='./login'>Ojoa 로그인페이지입니다.</Link></div>               
            </div>
            <div className="Title">
                <div className="txt_01"><Link to='./mypage'>Mypage</Link></div>
                <div className="txt_02"><Link to='./mypage'>포인트적립 및 배송확인 등</Link></div>               
            </div>
            <div className="Title">
                <div className="txt_01"><Link to='./order'>Order</Link></div>
                <div className="txt_02"><Link to='./order'>주문내역조회</Link></div>               
            </div>
            <div className="Title">
                <div className="txt_01"><Link to='./cart'>Cart</Link></div>
                <div className="txt_02"><Link to='./qna'>장바구니에 담긴 상품</Link></div>               
            </div>
            <div className="Title">
                <div className="txt_01"><Link to='./qna'>QnA</Link></div>
                <div className="txt_02"><Link to='./qna'>Ojoa 문의게시판입니다.</Link></div>               
            </div>
        </div>

    );
};

export default Title;
